import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <div>
        <Navigation />
        <Section id="welcome" title="Hi, I'm Andrew.">
          <PersonalSummary />
          <Education />
          <Technology />
        </Section>
        <Section id="projects" title="Projects" />
        <Section id="contact-me" title="Contact Me">
          <ContactMe />
        </Section>
      </div>
    );
  }
};

export default App;
